import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Haul.css";

// HERO IMAGES
import hero1 from "../assets/images/hero/hero1.jpg";
import hero2 from "../assets/images/hero/hero2.jpg";
import hero3 from "../assets/images/hero/hero3.jpg";
import hero4 from "../assets/images/hero/hero4.jpg";
import hero5 from "../assets/images/hero/hero5.jpg";
import hero6 from "../assets/images/hero/hero6.jpg";
import hero7 from "../assets/images/hero/hero7.jpg";
import hero8 from "../assets/images/hero/hero8.jpg";
import hero9 from "../assets/images/hero/hero9.jpg";
import hero10 from "../assets/images/hero/hero10.jpg";

const heroImages = [
  hero1,
  hero2,
  hero3,
  hero4,
  hero5,
  hero6,
  hero7,
  hero8,
  hero9,
  hero10,
];

const Haul = () => {
  const navigate = useNavigate();
  const [currentHero, setCurrentHero] = useState(0);

  /* HERO SLIDESHOW */
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentHero((prev) =>
        prev === heroImages.length - 1 ? 0 : prev + 1
      );
    }, 4500);

    return () => clearInterval(interval);
  }, []);

  return (
    <div className="haul-page">

      {/* HERO SECTION */}
      <section
        className="haul-hero"
        style={{
          backgroundImage: `url(${heroImages[currentHero]})`,
        }}
      >
        <div className="haul-hero-content">
          <h1 className="haul-heading">
  Flatbed & Specialized Hauling
</h1>

<p className="haul-subheading">
  Trusted nationwide freight solutions for oversized, heavy, and time-critical shipments.
</p>

        </div>
      </section>

      {/* INTRO */}
      <section className="haul-section light">
        <h2>Reliable Freight Transportation</h2>
        <p>
          RGM provides professional flatbed and specialized hauling services
          across the country. Our modern fleet and experienced drivers ensure
          your cargo moves safely and on schedule.
        </p>

        <div className="haul-features">
          <div className="feature-card">
            <h3>Flatbed Shipping</h3>
            <p>
              Steel, lumber, equipment, and construction materials handled
              with precision and care.
            </p>
          </div>

          <div className="feature-card">
            <h3>Oversized & Heavy Loads</h3>
            <p>
              Complete route planning, permits, and escorts managed by experts.
            </p>
          </div>

          <div className="feature-card">
            <h3>Dedicated Fleet</h3>
            <p>
              Modern equipment, trained drivers, and a safety-first approach.
            </p>
          </div>
        </div>
      </section>

      {/* STATS */}
      <section className="haul-stats">
        <div className="stat-box">
          <h3>24/7</h3>
          <p>Dispatch Support</p>
        </div>

        <div className="stat-box">
          <h3>98%</h3>
          <p>On-Time Delivery</p>
        </div>

        <div className="stat-box">
          <h3>50+</h3>
          <p>States Served</p>
        </div>

        <div className="stat-box">
          <h3>100%</h3>
          <p>Safety Commitment</p>
        </div>
      </section>

      {/* CTA */}
      <section className="haul-cta">
        <h2>Get Your Free Rate Quote</h2>
        <p>
          Request a fast and accurate hauling quote customized to your freight
          needsâ€”no obligation.
        </p>

        <button
          className="haul-cta-btn"
          onClick={() => navigate("/haulrgm")}
        >
          Free Rate Quote
        </button>
      </section>

    </div>
  );
};

export default Haul;
